import Card from 'react-bootstrap/Card';

const Link = props => {
    return (
        <Card
    bg="warning"
    key="1"
    text="black"
    style={{ width: '18rem' }}
    className="mb-2"
  >

    <Card.Body>
      <Card.Text>
      {props.text}
      </Card.Text>
      <Card.Text>
      {props.url}
      </Card.Text>
      <Card.Link href={props.url}>Card Link</Card.Link>
    </Card.Body>
  </Card>
        )
}

export default Link;
